import { Route, Switch } from 'react-router-dom';
import './scss/App.scss';

// Views
import Home from './views/Home';

const App = (props) => {
    return (
        <Switch>
            <Route exact path="/">
                <Home/>
            </Route>
            <Route path="/produk/add">
                <TambahProduk/>
            </Route>
        </Switch>
    )
}

export default App;
